import { Link } from 'react-router-dom';

function Hero() {
  return (
    <div className='hero-main'>
      <div className='hero-text'>
        <h6 className='hero-subtitle'>مرحبًا بكم في شاورما حتاب</h6>
        <h4 className='hero-title'><em>مرحبًا</em> في مطعمنا</h4>
        <div className='main-button'>
          <Link to='/browse'>استعرض الآن</Link>
        </div>
      </div>
    </div>
  );
}

export default Hero;
